        const fetchPosts =async ()=>{
         const res=await axios.get("/posts");
         console.log(res);
        }
        fetchPosts();
    },[])
    return (
        <>
        <Header/>
        <div className="home">
            <Posts />
            <Sidebar />
        </div>
        </>
    );
}
